import React from 'react'
import './Readmore.scss'

const Readmore = () => {
	return (
		<div className='slide'>
			<div className='slide__background'>
				<img src="https://dthomefix.wpengine.com/wp-content/uploads/2016/05/slider2-100x50.jpg" alt="" />
			</div>
		</div>
	)
}

export default Readmore
